webpackJsonp([0x78907bdd72e6],{366:function(n,i){n.exports={data:{markdownRemark:{html:"<p>Общий порядок действий установки программ в PlayOnLinux, про установку PlayOnLinux не расписываю, т.к. она сильно зависит от системы</p>\n<p>[xcut]</p>\n<p>_  <strong>1.</strong> Запускаем playonlinux\n_ Установка > Установить программу, отсутствующую в списке\nul</p>\n<ul>\n<li>ввести имя н-р. NAME</li>\n<li>выбираем нужную версию wine (потом можно поменять)</li>\n<li>когда нам предложат выбрать инсталлятор нажать отмену\n/ul\n_  <strong>2.</strong> Выискиваем в интернетах что нам надо установить в wine\n_  <strong>3.</strong> При помощи winetricks установим необходимые компоненты, н-р mfc42 WINEPREFIX=~/.PlayOnLinux/wineprefix/NAME/ WINEARCH=win32 sh winetricks mfc42\nwin32 изменить на win64, если 64bit</li>\n</ul>\n<p>_  <strong>4.</strong> Выполнить файл .exe на этом виртуальном диске\n_  <strong>5.</strong> Сделать новый ярлык из этого виртуального диска</p>",frontmatter:{date:"2015-09-25 15:01:04",path:"/page/winepol-ustanovka-i-zapusk-prilozhenij",title:"Wine(POL) установка и запуск приложений"}}},pathContext:{}}}});
